        <h1>Reg√≠strate</h1>
    </div>
    <Form >
        <div>
            <label>EMAIL</label>
            <input type="text" placeholder="Ingresa tu email" name= "email"/>
        </div>
        <div>
            <label>PASSWORD</label>
